import React, { useState } from "react";

const NanseaWebsite = () => {
  const [modal, setModal] = useState(false);

  const toggleModal = () => {
    setModal(!modal);
  };

  return (
    <main>
      <h1>nansea website project descr.</h1>
      <img onclick={toggleModal}></img>>
    </main>
  );
};

export default NanseaWebsite;
